<style>
/*買い物カゴボタン*/
#rakutenLimitedId_aroundCart input {
  width: 233px;
  height: 52px;
  background:url(https://image.rakuten.co.jp/gift83/cabinet/b/f.jpg) #fcfcfc no-repeat;
  overflow: hidden;
  border-width: 0px;
  cursor: pointer !important;
  text-indent: 150%;
  white-space: nowrap;
  margin: 5px 0 0 0;
}


/*個数入力*/
#rakutenLimitedId_aroundCart input#units {
  border:solid #ccc 1px;
  background:#fff!important;
  width:30px;
  height:30px;
  cursor:auto;
  padding:7px 7px 7px 3px;
  text-indent: 0px;
  overflow: hidden;
}


/*お問い合わせボタン*/
#rakutenLimitedId_aroundCart font input {
  width: 233px;
  height: 25px;
  background:url(https://image.rakuten.co.jp/gift83/cabinet/b/11.jpg) #fcfcfc no-repeat;
  overflow: hidden;
  border-width: 0px;
  cursor: pointer;
  display: block;
}

span.choice {
	background:url() no-repeat;
        background: #d9d5ca;

	display: block;
	width: 306px;
	height: 20px;
	font-size:12px;

	margin-top:15px;
        padding: 10px 0 0 15px;
        color:#000000;
}


/* 項目選択肢 */
#rakutenLimitedId_aroundCart span.inventory_choice_name {
    font-size:110%;
}

#rakutenLimitedId_aroundCart select[name="choice"] {
    font-size:14px !important;
    padding-top:8px !important;
    padding-bottom:8px !important;
    width: 320px;
}




</style>

